import * as React from 'react';

/**
 * Este componente se usará para buscar un usuario, y si existe,
 * lo añadirá como amigo del usuario actual.
 * @param props 
 * @returns 
 */

export default function AddFriend (props: any) {
    return (
        <div>
            <label>Añadir amigo: </label>
            <input type="text" />
        </div>
    );
}
